import React, { Component } from "react";
import Post from './Post'

export default class AllPost extends Component {



    render() {
		return (
            <div>
                {
                    this.props.posts.map((p) => (
                        <Post post={p}/>
                    ))
                }
            </div>



		)
	}
}
